import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Order = () => {
  const navigate = useNavigate();
  const [orders, setOrders] = useState([]);
  const handleLogout = () => {
    localStorage.removeItem("fullname");
    window.location.reload();
  };

  useEffect(() => {
    axios.get('http://localhost:8080/api/orders')
      .then(response => {
        setOrders(response.data);
      })
      .catch(error => {
        console.error('Lấy danh sách đơn hàng thất bại:', error);
      });
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post("http://localhost:8080/api/orders", {
        // ... (your request payload)
      });

      if (response.ok) {
        console.log("Order placed successfully!");

        // Assume the order response includes product details
        const orderedProducts = response.data.products;

        // Display the ordered products or handle as needed
        console.log("Ordered Products:", orderedProducts);

        // Clear the form after successful submission
        // ...

        // Remove cart items from localStorage
        localStorage.removeItem("cartItems");

        // Display success message to the user
        alert("Đặt hàng thành công!");

        // Redirect to the Order page
        navigate("/profile/order");

        // Reload the page (if needed)
        window.location.reload();
      } else {
        console.error("Error placing order:", response.status, response.statusText);
      }
    } catch (error) {
      console.error("Error:", error.message);
    }
  };

  return (
    <section className="section-content padding-y">
      <div className="container">
        <div className="row">
          <aside className="col-md-3">
            {/* ... (existing code) */}
          </aside>
          <main className="col-md-9">
            <article className="card mb-4">
              <header className="card-header">
                {/* ... (existing code) */}
              </header>
              <div className="card-body">
                <div className="row">
                  <div className="col-md-8">
                    <h6 className="text-muted">Delivery to</h6>
                    {/* ... (existing code) */}
                  </div>
                  <div className="col-md-4">
                    <h6 className="text-muted">Payment</h6>
                    {/* ... (existing code) */}
                  </div>
                </div>
              </div>
              <div className="table-responsive">
                <table className="table table-hover">
                  <tbody>
                    {/* Map over orderedProducts and display each product */}
                    {orderedProducts.map((product, index) => (
                      <tr key={index}>
                        <td width="65">
                          <img src={product.image} style={{ width: "80%" }} alt={`Product ${index}`} />
                        </td>
                        <td>
                          <p className="title mb-0">{product.name}</p>
                          <var className="price text-muted">{product.price}</var>
                        </td>
                        <td>{product.seller}</td>
                        <td width="250">
                          <a href="#" className="btn btn-outline-primary">Track order</a>
                          <div className="dropdown d-inline-block">
                            <a href="#" data-toggle="dropdown" className="dropdown-toggle btn btn-outline-secondary">More</a>
                            <div className="dropdown-menu dropdown-menu-right">
                              <a href="#" className="dropdown-item">Return</a>
                              <a href="#" className="dropdown-item">Cancel order</a>
                            </div>
                          </div>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </article>
          </main>
        </div>
      </div>
    </section>
  );
};

export default Order;
